INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "キャル", 7, 106001, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, "2015/12/17 15:00:00", 0, 1, 7001);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "コッコロ", 7, 105901, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, "2015/12/17 15:00:00", 0, 1, 7002);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "ペコリーヌ", 7, 105801, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, "2015/12/17 15:00:00", 0, 1, 7003);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "ペコリーヌ", 10, 105801, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, "2015/12/17 15:00:00", 0, 1, 10001);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "キャル", 10, 106001, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, "2015/12/17 15:00:00", 0, 1, 10002);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "コッコロ", 10, 105901, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, "2015/12/17 15:00:00", 0, 1, 10003);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2104010, "シェフィ", 10, 106401, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 2, "2015/12/17 15:00:00", 0, 1, 10004);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "ペコリーヌ", 12, 105801, "2030/12/17 14:59:59", 0.0, 0.0, 1, -416.5, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, "2015/12/17 15:00:00", 0, 1, 12001);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "キャル", 13, 106001, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, "2015/12/17 15:00:00", 0, 1, 13001);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "コッコロ", 13, 105901, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, "2015/12/17 15:00:00", 0, 1, 13002);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2104010, "シェフィ", 13, 106401, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 2, "2015/12/17 15:00:00", 0, 1, 13003);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "ペコリーヌ", 13, 105801, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, "2015/12/17 15:00:00", 0, 1, 13004);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "コッコロ", 14, 105901, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, "2015/12/17 15:00:00", 0, 1, 14001);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2104010, "シェフィ", 14, 106401, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 2, "2015/12/17 15:00:00", 0, 1, 14002);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "ペコリーヌ", 14, 105801, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, "2015/12/17 15:00:00", 0, 1, 14003);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "キャル", 14, 106001, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, "2015/12/17 15:00:00", 0, 1, 14004);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "コッコロ", 15, 105901, "2030/12/17 14:59:59", 0.0, 0.0, 1, -470.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, "2015/12/17 15:00:00", 0, 1, 15001);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2104010, "シェフィ", 16, 106401, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 2, "2015/12/17 15:00:00", 0, 1, 16001);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "ペコリーヌ", 16, 105801, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, "2015/12/17 15:00:00", 0, 1, 16002);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "キャル", 16, 106001, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, "2015/12/17 15:00:00", 0, 1, 16003);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "コッコロ", 16, 105901, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, "2015/12/17 15:00:00", 0, 1, 16004);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "コッコロ", 17, 105901, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, "2015/12/17 15:00:00", 0, 1, 17002);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "キャル", 25, 106001, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, "2015/12/17 15:00:00", 0, 1, 17004);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "コッコロ", 25, 105901, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, "2015/12/17 15:00:00", 0, 1, 17005);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2104010, "シェフィ", 25, 106401, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 2, "2015/12/17 15:00:00", 0, 1, 17006);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "ペコリーヌ", 25, 105801, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, "2015/12/17 15:00:00", 0, 1, 17007);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "カリン", 18, 190801, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, "2015/12/17 15:00:00", 0, 1, 18001);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "カリン", 18, 190801, "2030/12/17 14:59:59", 0.0, 0.0, 2, -363.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 1, "2015/12/17 15:00:00", 0, 1, 18002);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "カリン", 19, 190801, "2030/12/17 14:59:59", 0.0, 0.0, 3, -470.0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 1, "2015/12/17 15:00:00", 0, 1, 19001);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "カリン", 19, 190801, "2030/12/17 14:59:59", 0.0, 0.0, 4, -470.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 1, "2015/12/17 15:00:00", 0, 1, 19002);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "カリン", 20, 190801, "2030/12/17 14:59:59", 0.0, 0.0, 5, -470.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 1, "2015/12/17 15:00:00", 0, 1, 20001);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "カリン", 20, 190801, "2030/12/17 14:59:59", 0.0, 0.0, 6, -470.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 1, "2015/12/17 15:00:00", 0, 1, 20002);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "キャル", 21, 106001, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, "2015/12/17 15:00:00", 0, 1, 21001);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "コッコロ", 21, 105901, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, "2015/12/17 15:00:00", 0, 1, 21002);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2104010, "シェフィ", 21, 106401, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 2, "2015/12/17 15:00:00", 0, 1, 21003);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "ペコリーヌ", 21, 105801, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, "2015/12/17 15:00:00", 0, 1, 21004);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "カリン", 22, 190801, "2030/12/17 14:59:59", 0.0, 0.0, 1, -430.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, "2015/12/17 15:00:00", 0, 1, 22001);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "カリン", 22, 190801, "2030/12/17 14:59:59", 0.0, 0.0, 2, -430.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 1, "2015/12/17 15:00:00", 0, 1, 22002);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "カリン", 23, 190801, "2030/12/17 14:59:59", 0.0, 0.0, 3, -430.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 1, "2015/12/17 15:00:00", 0, 1, 23001);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "カリン", 23, 190801, "2030/12/17 14:59:59", 0.0, 0.0, 4, -430.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 1, "2015/12/17 15:00:00", 0, 1, 23002);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "エリコ（バレンタイン）", 24, 109001, "2030/12/17 14:59:59", 4.08, 8.0, 1, -385.0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, "2019/01/31 12:00:00", 10011, 2, 24001);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "エリコ（バレンタイン）", 24, 109001, "2030/12/17 14:59:59", 5.0, 8.0, 2, -385.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 1, "2019/01/31 12:00:00", 10011, 2, 24002);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "エリコ（バレンタイン）", 24, 109001, "2030/12/17 14:59:59", 10.11, 8.0, 3, -385.0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 1, "2019/01/31 12:00:00", 10011, 2, 24003);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "エリコ（バレンタイン）", 24, 109001, "2030/12/17 14:59:59", 4.0, 8.0, 4, -385.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 1, "2019/01/31 12:00:00", 10011, 2, 24004);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "エリコ（バレンタイン）", 24, 109001, "2030/12/17 14:59:59", 6.0, 8.0, 5, -385.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 1, "2019/01/31 12:00:00", 10011, 2, 24005);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "エリコ（バレンタイン）", 24, 109002, "2030/12/17 14:59:59", 0.0, 0.0, 6, 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 1, "2019/01/31 12:00:00", 10011, 1, 24006);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "エリコ（バレンタイン）", 24, 109002, "2030/12/17 14:59:59", 0.0, 0.0, 7, 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 1, "2019/01/31 12:00:00", 10011, 1, 24007);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "エリコ（バレンタイン）", 24, 109002, "2030/12/17 14:59:59", 0.0, 0.0, 8, 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 1, "2019/01/31 12:00:00", 10011, 1, 24008);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "エリコ（バレンタイン）", 24, 109002, "2030/12/17 14:59:59", 0.0, 0.0, 9, 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 1, "2019/01/31 12:00:00", 10011, 1, 24009);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "エリコ（バレンタイン）", 24, 109002, "2030/12/17 14:59:59", 0.0, 0.0, 10, 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 1, "2019/01/31 12:00:00", 10011, 1, 24010);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "シズル（バレンタイン）", 24, 109101, "2030/12/17 14:59:59", 2.12, 8.0, 1, -385.0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, "2019/01/31 12:00:00", 10011, 2, 24011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "シズル（バレンタイン）", 24, 109101, "2030/12/17 14:59:59", 4.19, 8.0, 2, -385.0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 5, "2019/01/31 12:00:00", 10011, 2, 24012);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "シズル（バレンタイン）", 24, 109101, "2030/12/17 14:59:59", 2.3, 8.0, 3, -385.0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 2, "2019/01/31 12:00:00", 10011, 4, 24013);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "シズル（バレンタイン）", 24, 109102, "2030/12/17 14:59:59", 0.0, 0.0, 4, 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 1, "2019/01/31 12:00:00", 10011, 1, 24014);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "シズル（バレンタイン）", 24, 109101, "2030/12/17 14:59:59", 5.23, 8.0, 5, -385.0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, "2019/01/31 12:00:00", 10011, 2, 24015);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "シズル（バレンタイン）", 24, 109102, "2030/12/17 14:59:59", 0.0, 0.0, 6, 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 1, "2019/01/31 12:00:00", 10011, 1, 24016);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "シズル（バレンタイン）", 24, 109101, "2030/12/17 14:59:59", 5.01, 8.0, 7, -385.0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 1, "2019/01/31 12:00:00", 10011, 2, 24017);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "シズル（バレンタイン）", 24, 109102, "2030/12/17 14:59:59", 0.0, 0.0, 8, 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 1, "2019/01/31 12:00:00", 10011, 1, 24018);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "シズル（バレンタイン）", 24, 109102, "2030/12/17 14:59:59", 0.0, 0.0, 9, 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 1, "2019/01/31 12:00:00", 10011, 1, 24019);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "シズル（バレンタイン）", 24, 109102, "2030/12/17 14:59:59", 0.0, 0.0, 10, 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 1, "2019/01/31 12:00:00", 10011, 1, 24020);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2104010, "シェフィ", 26, 106401, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 2, "2015/12/17 15:00:00", 0, 1, 26001);
