INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "キャル", 26, 106001, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 1, "2015/12/17 15:00:00", 0, 1, 26003);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "コッコロ", 26, 105901, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 1, "2015/12/17 15:00:00", 0, 1, 26004);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2104010, "シェフィ", 27, 106401, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 2, "2015/12/17 15:00:00", 0, 1, 27001);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "ペコリーヌ", 27, 105801, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 1, "2015/12/17 15:00:00", 0, 1, 27002);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "キャル", 27, 106001, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 1, "2015/12/17 15:00:00", 0, 1, 27003);
