INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "キャル", 43, 106001, "2030/12/17 14:59:59", 0.0, 0.0, 1, -363.0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 1, "2015/12/17 15:00:00", 0, 1, 43003);
