INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "アメス", 44, 123001, "2030/12/17 14:59:59", 0.0, 0.0, 2, -416.5, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 1, "2015/12/17 15:00:00", 0, 1, 43005);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0, "アメス", 45, 123001, "2030/12/17 14:59:59", 5.79, 0.0, 3, -416.5, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 1, "2015/12/17 15:00:00", 0, 2, 43006);
